import React from "react";
import Header from "./Header";
export default function Contact() {
  return (
    <>
      <div>
        <Header />
      </div>
      <div>
        <h2 className="text-light">Get In Touch</h2>
      </div>
      <div className="row mt-5 ms-5 container">
        <div className="col-md-6 p-5 back text-start rounded-4">
          <h4>Let's make something great!</h4>
          <h6>If you would like to find out more about what<br/>
          Sumago Infotech can do for your business or to<br/>
          receive a project quote,don't hesitate to contact us.</h6>
        </div>

        <div className="col-md-6"></div>
      </div>
    </>
  );
}
